  estate until 1954 when it was bought from the family by Harold Edward Williams and his son, Colin Sydney Wallis
  Williams. Harold had built his "Ngamoe" homestead on the property in 1924 when he married. Harold moved to
  Gisborne in 1958 when Colin married, by which time Colin had taken over "Kaharau". It was here that Colin
  established the Kaharau Angus Stud in 1954. An annual sale was held on the property with cattle being sold to
  most cattle breeding countries in the world. In 1991 "Kaharau" was sold and the Angus Stud was moved to
  "Coventry" station, just south of Gisborne.
